<?phpnamespace Nemundo\Bfs\Abstimmung\Install;use Nemundo\App\Application\Type\Install\AbstractUninstall;use Nemundo\Bfs\Abstimmung\Content\Abstimmung\AbstimmungContentType;use Nemundo\Bfs\Abstimmung\Content\AbstimmungResultatWidget\AbstimmungResultatWidgetContentType;use Nemundo\Bfs\Abstimmung\Content\Stimmbeteiligung\StimmbeteiligungContentType;use Nemundo\Bfs\Abstimmung\Data\AbstimmungModelCollection;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;class AbstimmungUninstall extends AbstractUninstall{    public function uninstall()    {        (new ContentTypeSetup())            ->removeContentType(new StimmbeteiligungContentType())            ->removeContentType(new AbstimmungContentType())            ->removeContentType(new AbstimmungResultatWidgetContentType());        (new ModelCollectionSetup())->removeCollection(new AbstimmungModelCollection());    }}